#include <regex>

std::string markdown_to_html(std::string& markdown) {
  // Replace headings
  std::regex heading_regex("#+ (.*)");
  markdown = std::regex_replace(markdown, heading_regex, "<h1>$1</h1>");

  // Replace bold text
  std::regex bold_regex("\\*\\*(.*)\\*\\*");
  markdown = std::regex_replace(markdown, bold_regex, "<strong>$1</strong>");

  // Replace italic text
  std::regex italic_regex("\\*(.*)\\*");
  markdown = std::regex_replace(markdown, italic_regex, "<em>$1</em>");

  // Replace links
  std::regex link_regex("\\[(.*)\\]\\((.*)\\)");
  markdown = std::regex_replace(markdown, link_regex, "<a href=\"$2\">$1</a>");

  // Replace code blocks
  std::regex code_regex("```(.*)```");
  markdown = std::regex_replace(markdown, code_regex, "<pre><code>$1</code></pre>");

  return markdown;
}
```

This function uses regular expressions to search for and replace markdown formatting with the corresponding HTML tags. It replaces headings, bold text, italic text, links, and code blocks.

